import React from 'react';
import TodoItem from '../TodoItem/TodoItem'; // Обновите путь в зависимости от вашей структуры
import './TodoList.css';

function TodoList({ tasks, deleteTask, toggleTaskCompletion }) {
  console.log('Received tasks:', tasks);

  if (!tasks || !Array.isArray(tasks)) {
    console.error('Invalid tasks prop:', tasks);
    return <div>No tasks available</div>;
  }

  return (
    <div className="todo-list">
      {tasks.map((task, index) => (
        <TodoItem
          key={index}
          task={task}
          deleteTask={() => deleteTask(index)}
          toggleTaskCompletion={() => toggleTaskCompletion(index)}
        />
      ))}
    </div>
  );
}

export default TodoList;
